  input: '"TEXT","F3XA","C00187450","This amended report is in response to the letter
    concerning our 30 Day Post General Report (11/18-12/27/02)  We have corrected
    the individuals occupation and employer of all individuals that contributed in
    excess of $200 in the calendar year.  As requested, we are pleased to clarify
    that none of the funds received from the NRSC or the RNC were used for the payments
    of yard signs or any other volunteer distributed campaign materials.  Therefore
    the payments for yard signs do meet the definition of volunteer exempt activity.  With
    respect to your question regarding GOTV expenditures, these were, in every instance,
    Generic-Vote Republican call that did not reference a specifically identified
    Federal Candidate and were properly disclosed on Schedule H4 and there is no In-Kind
    or Coordinated expenditures with respect to these disbursements."'
